CREATE DEFINER=`root`@`localhost` PROCEDURE `DeleteUserPost`(IN post_id_param INT, IN user_id_param INT)
BEGIN
    DECLARE post_exists INT;

    
    CREATE TEMPORARY TABLE IF NOT EXISTS TempOutput (message VARCHAR(255));

    
    SELECT COUNT(*) INTO post_exists FROM Posts WHERE post_id = post_id_param AND user_id = user_id_param;

    IF post_exists > 0 THEN
        
        DELETE FROM Posts WHERE post_id = post_id_param;
        INSERT INTO TempOutput(message) VALUES ('Post deleted successfully');
    ELSE
        
        INSERT INTO TempOutput(message) VALUES ('Post not found or user not authorized to delete this post');
    END IF;
END ;;
