CREATE DEFINER=`root`@`localhost` PROCEDURE `ToggleLike`(IN user_id INT, IN post_id INT)
BEGIN
    DECLARE likeExists BOOLEAN;

    
    SELECT EXISTS(SELECT 1 FROM Likes WHERE user_id = user_id AND post_id = post_id) INTO likeExists;

    IF likeExists THEN
        
        DELETE FROM Likes WHERE user_id = user_id AND post_id = post_id;
    ELSE
        
        INSERT INTO Likes (user_id, post_id, like_date) VALUES (user_id, post_id, NOW());
    END IF;
END ;;
DELIMITER ;
