CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateUser`(IN user_id_param INT, IN field_param VARCHAR(64), IN value_param VARCHAR(255))
BEGIN
    SET @query = CONCAT('UPDATE Users SET ', field_param, ' = ? WHERE user_id = ?');
    SET @value = value_param;
    SET @u_id = user_id_param;

    PREPARE stmt FROM @query;
    EXECUTE stmt USING @value, @u_id;
    DEALLOCATE PREPARE stmt;
END ;;
DELIMITER ;
